CREATE DATABASE IF NOT EXISTS testdatabase;

USE testdatabase;

CREATE TABLE IF NOT EXISTS customers (
  customer_id CHAR(36) PRIMARY KEY, -- Usando CHAR(36) para armazenar UUID
  name VARCHAR(255),
  email VARCHAR(255),
  address VARCHAR(255)
);

CREATE TABLE IF NOT EXISTS sales (
  id CHAR(36) PRIMARY KEY, -- Usando CHAR(36) para armazenar UUID
  product_name VARCHAR(255),
  quantity INT,
  price DECIMAL(10, 2),
  sale_date TIMESTAMP,
  customer_id CHAR(36), -- Usando CHAR(36) para armazenar UUID
  status VARCHAR(50),
  FOREIGN KEY (customer_id) REFERENCES customers(customer_id) -- Chave estrangeira para relacionar com a tabela customers
);

